column8:
携帯サイズのうがい薬、手洗い石けん液、手指消毒剤、手指消毒シート、マスクをまとめたセットです。<br>
サイズ：W175×D57×H140mm<br>
ケースサイズ：W325×D320×H155mm<br>
ケース入り数：12<br>
質量（内容量）：約290g<br>
セット内容：<br>
うがい薬コロロ　50ml×1本<br>
ウォッシュボンS　50ml×１本<br>
ヒビスコールSH　50ml×1本<br>
ヒビスコールガーゼ　10枚入り×１包<br>
サージカルマスク　個包装×５枚<br>
衛生対策のマニュアル付（和文・英文）<br><br>※マイコプラズマ・肺炎ウィルス・インフルエンザ・風邪・RSウィルス感染症などの飛沫感染予防としての対策であり100％効果があるものではありません。<br><br><img src="http://image.rakuten.co.jp/be-kan/cabinet/tel.jpg"><br><style type="text/css">
