手指をいたわりながらしっかり消毒。<br><br>
広範囲の微生物に対して簡便かつ持続的な消毒効果を発揮する無色のエタノール溶液です。手荒れ防止に配慮。<br><br>
有効成分：クロルヘキシジングルコン酸塩0.1w/v％<br><br>効能：皮膚・手指の洗浄及び消毒<br>
出荷単位：10本単位、サイズ：96×86×173mm
